import React, { Component } from 'react';
import './Header.css';
import {Navbar, Nav, NavDropdown, Container, Form, FormControl, Button} from 'react-bootstrap';


const Header = () => {
    return (
  <Navbar class="navBar" expand="lg">
    <Container>
      <Navbar.Brand href="#home">
        <img src={require('./src/DomusLogo.png')} alt='logo' class='logo'/>
     </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#link">Link</Nav.Link>
          <Button variant="outline-success" >Iniciar Sesion</Button>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  );
}

export default Header;

//export 'default' (imported as 'Header') was not found in './Componentes/Header.jsx' (module has no exports)
